create table building
(
bid int primary key,
bname char(20),
onfire int,
vertices int,
shape mdsys.sdo_geometry
);
create table firehydrant
(
fid int primary key,
shape mdsys.sdo_geometry
);

     COLUMN_NAME,
     DIMINFO,
     SRID)
  VALUES (
  'building',
  'shape',
  SDO_DIM_ARRAY(   -- 20X20 grid
    SDO_DIM_ELEMENT('X', 0, 820, 0.005),
    SDO_DIM_ELEMENT('Y', 0, 580, 0.005)
     ),
  NULL   -- SRID
);
     COLUMN_NAME,
     DIMINFO,
     SRID)
  VALUES (
  'firehydrant',
  'shape',
  SDO_DIM_ARRAY(   -- 20X20 grid
    SDO_DIM_ELEMENT('X', 0, 820, 0.005),
    SDO_DIM_ELEMENT('Y', 0, 580, 0.005)
     ),
  NULL   -- SRID
);



CREATE INDEX index_building ON BUILDING (SHAPE)
 INDEXTYPE IS MDSYS.SPATIAL_INDEX;
 
CREATE INDEX index_firehydrant ON FIREHYDRANT (SHAPE)
 INDEXTYPE IS MDSYS.SPATIAL_INDEX;





